import './App.css';
import "./components/buisnessCard"
import BuissnessCard from './components/buisnessCard';
import DropDown from './components/dropdown';
import {useState} from "react";

function App() {

  const [turn, setTurn] = useState("");
  const [hidePhone, setHidePhone] = useState("phoneInfo");

  const [turnSocials, setTurnSocials] = useState(""); 
  const [hideSocials, setHideSocial] = useState("socials");

  return (
    <div className="App">
      <BuissnessCard 
        turnPhone={turnPhone}
        setTurnPhone={setTurnPhone}
        setHidePhone={setHidePhone}

        turnSocials={turnSocials}
        setTurnSocials={setTurnSocials}
        setHideSocial={setHideSocial}
        />

      <DropDown 
      turnPhone={turnPhone}
      hidePhone={hidePhone}

      turnSocials={turnSocials}
      hideSocials={hideSocials}
       />
    </div>
  );
}

export default App;
